Gulp Linting
(() =&gt; {
    &#39;use strict&#39;;

    let gulp        = require(&#39;gulp&#39;);
    let nodemon     = require(&#39;gulp-nodemon&#39;);
    let jshint      = require(&#39;gulp-jshint&#39;);
    let scsslint    = require(&#39;gulp-scss-lint&#39;);

    gulp.task(&#39;lint&#39;, [&#39;lint:jshint&#39;, &#39;lint:jscs&#39;, &#39;lint:scss&#39;]);

    // Tarea para pasar el JSHint a el código
    gulp.task(&#39;lint:jshint&#39;, () =&gt; {
        return gulp.src([
                &#39;gulpfile.js&#39;,
                &#39;public/js/**/*.js&#39;,
                &#39;routes/**/*.js&#39;,
                &#39;assets/modules/**/*.js&#39;,
                &#39;db/models/**/*.js&#39;
            ])
            .pipe(jshint(&#39;.jshintrc&#39;))
            .pipe(jshint.reporter(&#39;jshint-stylish&#39;));
    });

    // Tarea para pasar el JSCS a el código
    gulp.task(&#39;lint:jscs&#39;, () =&gt; {
        return gulp.src([
                &#39;gulpfile.js&#39;,
                &#39;public/js/**/*.js&#39;,
                &#39;routes/**/*.js&#39;,
                &#39;assets/modules/**/*.js&#39;,
                &#39;db/models/**/*.js&#39;
            ])
            .pipe(jscs())
            .pipe(jscs.reporter());
    });

    // Tarea para pasar el SCSS-Lint a el código
    gulp.task(&#39;lint:scss&#39;, () =&gt; {
        return gulp.src(&#39;assets/frontend/stylesheets/**/*.scss&#39;)
            .pipe(scsslint());
    });
})();

